import React from 'react';


function TableRow() {
	const rows = words.map(function(word) {
		return <tr key={word.id}>
		    <td>{word.english}</td>
            <td>{word.transcription}</td>
            <td>{word.russian}</td>
		</tr>;
	});

}

export default TableRow;
